def doTravelList(travel:str) -> list:
    travel_list = []
    for l in travel:
        travel_list.append(l)
    
    return travel_list

def main(travellist:list)-> int:
    up = '⇧'
    down = '⇩'
    nb_immeubles = 0
    Vtravel = 0

    for etape in travellist:
        if etape == up:
            Vtravel +=1
        elif etape == down:
            Vtravel -= 1
        if Vtravel == 0:
            nb_immeubles += 1
    
    return nb_immeubles


